import React from 'react'

const Pos = () => {
  return (
    <div style={{width:"100%",paddingTop:"40px",paddingBottom:"40px"}}>
        <div style={{width:"50%"}}>
            <img style={{width:"100%"}}src="./img/p.png" alt="" />
        </div>
        <div style={{width:"50%"}}></div>
    </div>
  )
}

export default Pos
